import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import './App.css'
import MovieGrid from "./componentes/Movie/MovieGrid"
import styles from "./App.module.css"

function App() {
 return  (
  <Router>
  <main>
      <h1 className={styles.title}>Movie</h1>

    </main>

      <Routes>
    <Route path='/movie'>Movie</Route>
    <Route path='/'>Home</Route>
      </Routes>
  </Router>
 )

    }
    export default App;
